import React from 'react';
import { Provider } from 'react-redux';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import './App.css';
import { Breadcrumb } from 'antd';
import { UnorderedListOutlined, PlusOutlined } from '@ant-design/icons';
import InputPage from './components/addTask/AddingTaskPage';
import ListScreen from './components/taskList/TaskListPage';
import store from './store/Store';
import HomePage from './components/home/HomePage';
import AboutPage from './components/about/AboutPage';

function App() {
  return (
    <Provider store={store}>
      <header />
      <nav>
        <div>
          <Breadcrumb>
            <Breadcrumb.Item href="/list">
              <UnorderedListOutlined />
              <span>Task List</span>
            </Breadcrumb.Item>
            <Breadcrumb.Item href="/addTask">
              <PlusOutlined />
              <span>Add Task</span>
            </Breadcrumb.Item>
          </Breadcrumb>
        </div>
      </nav>
      <div className="app">
        <Switch>
          <Route exact path="/" component={HomePage} />
          <Route path="/about" component={AboutPage} />
          <Route path="/addTask" component={InputPage} />
          <Route path="/list" component={ListScreen} />
        </Switch>
      </div>
    </Provider>
  );
}

export default App;
